function getChange(amt, coinArr) {

  var changeArr = [];

  while (amt &gt; 0) {
    if (amt &lt; coinArr[0]) {
      coinArr.shift();
    } else {
      changeArr.push(coinArr[0]);
      amt -= coinArr[0];
    }
  }

  return changeArr;

}

console.log(getChange(78,[25,10,5,1]));

