```
function multiplyby2(arr) {
	return arr.map(e =&gt; e * 2);
}

function filterArray(arr,val) {
	return arr.filter(e =&gt; e &gt; val)
}

function sumArray(arr) {
	return arr.reduce((prev,cur) =&gt; prev + cur);
}

function maxArray(arr) {
	return Math.max(...arr);
}

function findIndex(arr,val) {
	return arr.reduce(((foundIdx,curVal,curIdx) =&gt; val === curVal ? curIdx : foundIdx), undefined);
}

console.log(multiplyby2([2,4,6]));

console.log(filterArray([6,7,9],8));

console.log(sumArray([1,2,3]));

console.log(maxArray([1,2,3]));

console.log(findIndex(['a','b','c'],'b'));
```
